Description:
This Little Shop of Tricks Will Satisfy ALL your Erotic Kicks!
One sees this kink of small story everywhere. A little magic supply shop doing hardly any business. How do they survives? That was the problem facing shop owners Gwen (Siobahn Hunter) and her husband Don (Shone Taylor). When Don leaves town to get a loan from his tight-fisted uncle, in comes Gwen's friend Lucille (Shana McCullough) and convinces her to turn the store's big and vacant warehouse into an &quot;establishment of pleasure.&quot; What ensues is a raunchy, racy fun-filled romp within this whorehouse warehouse.
